const Container = styled(Space)`
    display: flex;
    align-items: center;
    flex-direction: column;
    height: 100%;
    padding-top: 10%;
`

const HowItWorks: React.FC = () => {
    return (
        <Container size="middle" direction="vertical">
            <TitleStyled>How It Works</TitleStyled>

        </Container>
    )
}

export default HowItWorks
